import React from "react";
import applys from "../../applys.json";

const Equipos = () => (
  <div style={{ padding: 24 }}>
    <h1>Equipos del Torneo</h1>
    {applys.map((team, idx) => (
      <div key={idx} style={{ border: "1px solid #ccc", margin: "16px 0", borderRadius: 8, padding: 16 }}>
        <h2>Team {idx + 1} - A confirmar</h2>
        <h3>Jugadores:</h3>
        <ul>
          {team.players.map((player, pidx) => (
            <li key={pidx}>
              <b>{player.name}</b>
            </li>
          ))}
        </ul>
      </div>
    ))}
  </div>
);

export default Equipos;
